ng his ability when Elves gave up the island and left for other places. He is still walking around the ruins when he doesnt have a place to protect, and punishing the adventurers and thieves who enter the ruins.','0.png'),(69,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','BOSS Flamestrike','','0.png'),(70,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Immortal Warrior created by Dark Elves to turn the war situation upside down. In the beginning of the war between Elves and Dark Elves, Dark Elves were cornered, but raised the knocked-down warriors again by testing the power of Dark Magic that they newly obtained. Farakelsus was one of the warriors raised again at the time, and became a monster that murdered innumerous Elves during the war. Although he was a brave Elven Knight once, he is left only with a thirst for blood of living things now.','0.png'),(71,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Beast created by Dark Elven dark magic. It is the beast that causes madness, which mystics of the School of Dark Arts created while studying beasts with great mental attacks. Although it does not look special on the outside, it can inflict powerful mental attacks. With its superior intelligence, it controls other beasts.','0.png'),(72,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Mortal Blow','','0.png'),(73,'https://l2db.ru/themes/l2db/images/skills/skill4297.png','Race','Divine','73.png'),(74,'https://l2db.ru/themes/l2db/images/skills/skill4336.png','Dark Attack Weak Point','Is vulnerable to a dark attack','74.png'),(75,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Evil Spirit worshiped by Langk Lizardmen like a god in the south of Gludio. He looks like a snake and has ruled the spiritual world of Lizardmen for hundreds of years. Resenting his cursed body and the Gods in the heaven who created it, he tries to slaughter all the messengers of the Gods discovered on earth. He is very violent and has burning ambitions to destroying the entire area of Gludio someday by controlling Langk Lizardmen.','0.png'),(76,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Ratman Chief living in Gludio Mountain. By hiring Bugbear Soldiers, he sacks tourists passing through Gludio Castle. To stop the sacking, the lord of Gludio put a reward on his head, but he continues sacking while hiding in the hill area away from the punitive forces.','0.png'),(77,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Devil summoned during the war between Elves and Dark Elves. As a subordinate of Devil Dagoniel, he was summoned by Dark Elves, and has murdered so many Elven Warriors. When Devil Dagoniel was liberated from the Dark Elves who summoned him, he was liberated, too. Presently, he is working by himself as Dagoniels adjutant.','0.png'),(78,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease Speed','Temporarily decreases Speed. Effect 1.','0.png'),(79,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Bleed','Inflicts a wound and reduces HP. Effect 2.','0.png'),(80,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','BOSS HP Drain','','0.png'),(81,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Succubus that is Lich King Icarus disciple and a spirit. Since Lich King Icarus owned Hardin\'s Academy by himself, hes been serving the king. He learned how to control bats and how to use dark magic from Lich King. He is the endlessly loyal slave of Icarus.','0.png'),(82,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Bow Attack','','0.png'),(83,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Aura Burn','','0.png'),(84,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Spear Attack','','0.png'),(85,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','BOSS Windstrike','','0.png'),(86,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Berserk','','0.png'),(87,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','BOSS Chant of Life','','0.png'),(88,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','BOSS Shield','','0.png'),(89,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','BOSS Aura Burn','','0.png'),(90,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease P.Atk','Temporarily decreases P.Atk. Effect 1.','0.png'),(91,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 23','A soldier of the Convict Mercenaries who were famous for their bravery during the Aden-Grecia War. Currently, he is the Commander of the Grecia Convict Mercenaries which are the surviving remnants in Aden Kingdom. Leading his subordinates left in Gludio, he is awaiting for an opportunity to return to his country.','0.png'),(92,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Lizardman Warrior who became famous after destroying the Mercenaries dispatched to destroy Lizardmen. Since he always attacked the enemies by tracking them down and won the battle, he gained the nickname of Tracker Leader.','0.png'),(93,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Priest of a newly emerged religion lately spreading among Lizardmen in the south of Gludio. As a fanatic serving Patriarch Kuroboros, he believes that the Patriarch will make Lizardmen glorious conquerors someday. Leading a small number of worshipers and disciples, he is spreading the glory of Kuroboros.','0.png'),(94,'https://l2db.ru/themes/l2db/images/skills/skill4031.png','Enhance P. Def.','Temporarily boosts P. Def. Effect 1.','94.png'),(95,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','BOSS Reflect Damage','','0.png'),(96,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Flamestrike','','0.png'),(97,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 24','Tragic lady who turned into a Succubus because of a mystic\'s curse. She loved a prince of the Gludio Waldner family, but committed a murder after being tricked by Dark Mage, and became Succubus upon his curse. Now, she sucks on energy of tourists traveling in Gludio, and prolongs her life day by day.','0.png'),(98,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 30','Langk Lizardman Matriarch serving Evil Spirit Bifrons. Thanks to the power of Evil Spirits and spells, she obtained strong power, and has captured and slaughtered priests traveling on the south road and those who call themselves the Disciples of God at the command of Bifrons. Recently, she is devoting herself to expanding the tribe\'s power to the north in line of confusion in the Gludio Territory.','0.png'),(99,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Prominence - Magic','','0.png'),(100,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Twister - Magic','','0.png'),(101,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Twister - Slow','','0.png'),(102,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Double Wind Fist','','0.png'),(103,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 25','A Pan who used to be a guardian protecting the Ancient Elven Forest and the long-time friend of Elves. While keeping their neutral position during the tragic fighting between Elves and Dark Elves, they finally became not welcomed on either side. Other Pans left for other territories owing to the Elves\' contemptuous treatment, but Pan Dryad is still here waiting for the peaceful past to return.','0.png'),(104,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 25','Unfortunate princess who was turned into a giant toad because of Evil Dark Mage Vijay\'s curse. Princess Molrang was the daughter of Unification King Raul with her beauty known across the kingdom, and Dark Mage Vijay cursed her because he could not have her even though he loved her, which is one of the often-told tales.','0.png'),(105,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Knight who used to govern a peaceful town, which is now called Ruins of Agony, before the Grecia War. Called Sir Grindel in his lifetime, he was captured and as a prisoner was brutally tortured to death after losing a battle against the Grecian Army. Perpetrators of Beleth hiding in the town used his body discarded in the middle of the town, resurrected him and made his soul fall. Having lost his royal knight qualities sacrificing himself for the town, he has turned into a devil that tries to spread his pain to all the other life forms, and wanders about in the Ruins of Agony.','0.png'),(106,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Handiwork of darkness created by evil necromancers to contain their desire. It has been known that he has a close relationship with the moon. Although many research squads were dispatched by mystics of the Ivory Tower to understand his true significance, all those people surrendered to Ikuntai\'s evil power and went to the side of evil. The record shows that no more research was done after then.','0.png'),(107,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease P.Atk','Temporarily decreases P.Atk. Effect 1','0.png'),(108,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Ghosts wandering about in the Ruins of Agony. They held the souls of residents who were killed at war held by Beleths followers with the powerful dark magic. They wander about in the Ruins of Agony, and extort souls from careless adventurers.','0.png'),(109,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Maraku Werewolf Chief. He used to set up an alliance with Urutu Orcs and peacefully coexist with them once, but suddenly attacked the Urutu Tribe while it weakened and inflicted a large blow. He is still lusting after the Immortal Plateau which is the Orcs homeland, and attacking Orcs with his inferiors.','0.png'),(110,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','When Merchants of Mammon try to get unpaid fees, Talloth shows up and collects money. Although it is a low-level devil that used to live in Hell, Talloth has entered into a contract with the ancient Merchants of Mammon, and helped them ever since. Only the elders of the Dwarf Guilds know its existence.','0.png'),(111,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Blaze - Magic','','0.png'),(112,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Powerful Hornet with a tiger stripe pattern. As a leader of several wasps, he is controlling the nest. Searching for the sweetest honey, he leads his inferiors and needles his way through Gludio Territory.','0.png'),(113,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','BOSS Spinning Slasher','','0.png'),(114,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Patriarch who showed up in the world while prophesying that he would become the Great Lizardman Conqueror. Showing off his sturdy and strong body, he negates the existing religion controlled by Evil Spirit Bifrons. By claiming that everyone can become a conqueror only through him, he is expanding the base of his followers.','0.png'),(115,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Hawkeye','','0.png'),(116,'https://l2db.ru/themes/l2db/images/skills/skill4029.png','Enhance P. Def.','','116.png'),(117,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Hydroblast - Magic','','0.png'),(118,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Magic Skill Block','Temporarily blocks the use of magic skills.','0.png'),(119,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','BOSS Life Drain','','0.png'),(120,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Spinning Slasher','','0.png'),(121,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 28','As the subordinate of Knight Barion, he gained the body of a devil through the magic of Devil Kernon. In contempt of General Karte who made him a devil and his loyal personal official, Barion, he is quietly growing hatred towards them. The thing that he doesn\'t know is that his hatred is driven by the conspiracy of Devil Kernon.','0.png'),(122,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Commander of all Ol Mahum tribes that occupy the old Partisan Hideaway. With the superior cleverness and bravery, he commands other Ol Mahums within the territory. He has the blood of Ol Mahum Commander which was made through the biological manipulation and improvement during the Era of Titans, and can directly command the minds of other Ol Mahums.','0.png'),(123,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A being that tries to invade the real world by crossing the Rift of Dimension along with the otherworldly devils. Due to the influence of the rift where time and space are distorted, it has a very unstable shape.','0.png'),(124,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Enhance P. Atk.','Temporarily boosts P. Atk. Effect 1.','0.png'),(125,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Twister','','0.png'),(126,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 29','Ghost of an Elf who loved the forest, nature and animals. Lamenting that nature became devastated and that lovable and innocent animals were killed through a countless number of meaningless wars, the elf stepped forward to protect them, but was murdered and eventually became a ghost. Protected by large boars that love him, he guards against strangers who might bring about a war again.','0.png'),(127,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Blaze','','0.png'),(128,'https://l2db.ru/themes/l2db/images/skills/skill4225.png','Resist Shock','Provides powerful resistance against Shock Attack.','128.png'),(129,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Resist Pole Arm','Provides resistance against pole arm attack.','0.png'),(130,'https://l2db.ru/themes/l2db/images/skills/skill4084.png','Resist Physical Attack','Provides powerful resistance against physical attack.','130.png'),(131,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 30','The Commander of the Katu Mercenaries. He is very violent and doesn\'t take care of himself, just like a mad man. Although he is a mercenary, he is always engaged in antagonistic activities against Elves and Dark Elves.','0.png'),(132,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 30','Leader of the most famous bandits in Gludio. After declaring that he will steal the most beautiful, never-changing and valuable thing in the world, he is trying to steal the heart of Poesia who is famous for her beauty. He is very romantic and possesses a vigorous personality.','0.png'),(133,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 30','An evil heathen serving Beleth who came from Devil\'s Isle. He is trying to cause horror and violence and make betrayal and conspiracies grow in the Gludio Territory. This horror is the source of devils\' power. All the serial murders, theft and arson that recently happened in Gludio are the work of Meana.','0.png'),(134,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Bloody Lord Nurka\'s obedient servant and veteran known to have been missing at war. As an overly proud Oel Mahum, he ignores and torments the lower-level tribe, Ol Mahums. Due to his weakness, he is not respected as much as Nurka is although he has more war achievements. According to a rumor, he is secretly plotting another conspiracy with Nurka, but nothing has been reported.','0.png'),(135,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A beast living in the Innadril Territory as one of the Evil Spirits born from Shilen\'s pain. He hates Eva who became the Goddess of Water instead of Shilen, and calls her a fake. He still thinks that the true Goddess of Water is Shilen only. He sneaked into Innadril where Eva\'s religion was widely spread, causing confusion among those who follow the Goddess of Water and is threatening them.','0.png'),(136,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Basilisk that obtained intelligence after mutating based on the influence of dark magic which polluted the Wasteland. He is bigger and stronger than other Basilisks, and has taken the weak ones as his inferiors with the power. He strongly hates other tribes around him. Due to his hatred, he kills every living thing seen before his eyes.','0.png'),(137,'https://l2db.ru/themes/l2db/images/skills/skill4286.png','Great Resist Sleep','Provides very powerful resistance against Sleep attack.','137.png'),(138,'https://l2db.ru/themes/l2db/images/skills/skill4288.png','Greater Resist Hold','Provides very strong resistance against Hold attack.','138.png'),(139,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Death Bomb','','0.png'),(140,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Triple Sonic Slash','','0.png'),(141,'https://l2db.ru/themes/l2db/images/skills/skill4307.png','Strong Type','Monster whose HP is 6 times higher than normal.','141.png'),(142,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Sonic Blaster','','0.png'),(143,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Chant of Life','','0.png'),(144,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease Speed','Temporarily decreases Speed. Effect 2.','0.png'),(145,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Cancel Magic','','0.png'),(146,'https://l2db.ru/themes/l2db/images/skills/skill4093.png','Evasion','Evasion is high.','146.png'),(147,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Royal Guard Captain of Stakato Queen Zyrnna. He is the soldier with the strongest power among Marsh Stakatos, leading the Royal Guards consisting only of Stakato nobles. He is as cruel as Zyrnna, and has murdered so many of his people at command of Queen.','0.png'),(148,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Leader of Zenta Lizardmen worshiping Antharas. He argues that Zenta Lizardmen are the predecessors of the Land Dragon. Leading the Lizardmen under his leadership, he attacks anyone who is hostile to Antharas.','0.png'),(149,'https://l2db.ru/themes/l2db/images/skills/skill4085.png','Critical Power','Provides powerful critical attack capability.','149.png'),(150,'https://l2db.ru/themes/l2db/images/skills/skill4086.png','Critical Chance','The critical attack rate is high.','150.png'),(151,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Ogre Stun','','0.png'),(152,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease Speed','Reduction in Speed. Effect 1.','0.png'),(153,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 33','Great Seer leading Vuku Orcs. He has more power than Chief Driko, and is held in high esteem as a god-like being. He feels sorry for his tribe wandering about in the human world and getting disdainful treatment at present. He is trying to take the tribe and return to the northern area which is the land of Orcs.','0.png'),(154,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Messenger sent by Bloody Lord Nurka to communicate with the high-ranking officials of the kingdom. He is a brave Ol Mahum Warrior, heading towards Aden with the top-secret mission.','0.png'),(155,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A pirate who ruled the South Sea of Giran along with Pirate King Zaken. He calls himself Zakens only rival. After hearing the news that Zaken was missing, he raided Zakens headquarters for his treasures, but lost all of his inferiors to Zaken and came back as a body that cannot even die any more. He is looking to take his revenge on Zaken someday.','0.png'),(156,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Dispel Fighter Buff','','0.png'),(157,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Paralysis','Paralyzed so that it cannot move temporarily.','0.png'),(158,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Fire Burn','','0.png'),(159,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Fire Burn - Magic','','0.png'),(160,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Solar Flare - Magic','','0.png'),(161,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 34','The only Orc Dark Mage with superior talent. He was once called the hope of Breka Orc Tribe, but fell into a conspiracy and was exiled. Dreaming of the day to take his revenge on those who expelled him, he is growing his power. He employs powerful Servitors using the summoning magic that he learned from Dark Elves.','0.png'),(162,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 45','Ruthless Queen of Marsh Stakatos in the Cruma Marshlands. She is notorious for her mercilessness and cruelty to both her army and enemy alike. She killed anyone who went against her, including her children and subordinates. She has the burning ambition to build a kingdom just for Marsh Stakatos someday.','0.png'),(163,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Servitor of Wiseman Cronos living in the Hunters Village. To get ingredients for the wonder drug of happiness that Cronos is making, he came to Innadril. After being sucked into watching the world for a while, Mumu forgot why he came here, and didn\'t return to Cronos because he was afraid of being scolded.','0.png'),(164,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Brave Knight executed after rejecting the brutal execution order from Duke Ashton and standing on the side of the peasants during the Dion Peasant Riot. He killed Guillotine who slaughtered not only the captured Peasant Rebels, but also their family members, and was brutally executed for that. Due to his rage over Ashtons injustice, he became a ghost.','0.png'),(165,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease Atk.Speed','Temporarily decreases Atk.Speed. Effect 1.','0.png'),(166,'https://l2db.ru/themes/l2db/images/skills/skill4299.png','Race','Dragon','166.png'),(167,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Heal Queen Ant1','','0.png'),(168,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Heal Queen Ant2','','0.png'),(169,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 35','Lord of Marsh Stakatos ruled by Devil Rahha. He is directly under mental control of Rahha, and cultivates the Stakato Army for Rahha. He is the powerful rival of Queen Jeruna of Marsh Stakatos living in the Cruma Marshlands.','0.png'),(170,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 35','Timak Orc Leader praised as the great soul by his subordinate Orcs due to his bravery and wisdom. Lamenting that his inferiors of the tribe whom he used to be proud of are losing bravery and honor and gradually turning into savages, he left the tribe and retired. He is going crazy because he hates himself for not being able to do anything to stop the collapse of the tribe that he loves.','0.png'),(171,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 35','Summoner Sejarr\'s Servitor dispatched from the Ivory Tower to block Devil Beleth. Sejarr cast the powerful dark magic to seal Beleth, but died of Beleth\'s reflective reaction. However, Phantom who was the only one that did not disappear among Sejarr\'s Servitors left. It was polluted by the dark magic of Beleth and the Ivory Tower, and reconciled with the Wasteland. Although he thinks his owner\'s death was unjust, he shows strong hostility towards other mystics.','0.png'),(172,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 45','Executioner who kept the Execution Ground during the Peasant Riot, and executed a countless number of innocent farmers. While brutally killing the family who came to see him at the command of Duke Ashton at that time, he was murdered instead. Due to the crimes he committed when he was alive, he was cursed not to rest in peace, and has been endlessly wandering about in the Execution Ground.','0.png'),(173,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A low-level devil mistakenly summoned by Shaman King Selu due to a summoning accident. Due to the forced summoning, he lost the way to return to his original place. Concealing his identity, he attacks tourists passing by and collects their souls to grow the power to return.','0.png'),(174,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Tasaba Lizardman Captain living in the field of Innadril. At the command of the Water Dragon, Tasaba Lizardmen serving the Water Dragon Fafurion live in the field and keep the Land of Holy Water. He laments that the world is in the era of humans, and misses the past. Every time a full moon comes, he conducts a holy ritual dedicated to the Water Dragon.','0.png'),(175,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Mercenary hired by a lord during the Dion Peasants\' Riot. He was told that he could get eternal life if he collected souls and dedicated them to Shilen, and slaughtered a countless number of innocent peasants. Fed up with his brutality, Duke Ashton finally executed him. Even after his death, his desire to get eternal life still remains and he comes back to life again as an Undead. Presently, he is wandering about near Dion Castle and killing innocent people.','0.png'),(176,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','BOSS Twister','','0.png'),(177,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Gargoyle Lord living in the Wasteland and ruling the Gargoyles. With very strong competitiveness, he is resisting the control of Ancient Gargoyles. Rather than waiting for the goddesss resurrection that may not ever take place, he is trying to build a kingdom for Gargoyles with the power that they possess at present.','0.png'),(178,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Captain of the Red Eye which is the powerful Mercenary band consisting of Convicts. Like other Convicts, he was dispatched during Grecias invasion, but got left behind by their command when they lost, and did not return to his country. Calling the Grecian Army that gave him up and ran away as cowards, he stays in the Dion Territory occupied during the war, sacking and destroying others. He has a delusion that he can win the war only with the Red Eye.','0.png'),(179,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease MP','Decreases MP. Effect 2.','0.png'),(180,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','One of the monster eyes performing as a spy of Devil Beleth during the Rebellion of Beleth. Now that Beleth is sealed away, it is in charge of providing Beleths followers with information.','0.png'),(181,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Leader of Wyrms leading the Wyrms in Gorgon\'s Flower Garden and fighting against Gorgons that occupied the area. Being cranky and having a desire to have entire possession, he is driving Wyrms who are not interested in the war with Gorgons into the war. He hates Gorgon Queen Stenoa.','0.png'),(182,'https://l2db.ru/themes/l2db/images/skills/skill4095.png','Damage Shield','Reflects a portion of the damage inflicted by the enemy during a close P. Atk back upon him.','182.png'),(183,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Fall in accuracy','Accuracy is reduced temporarily. Effect 1.','0.png'),(184,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Poison','Gradually reduces HP. Effect 2.','0.png'),(185,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Haste','','0.png'),(186,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Clan Buff - Damage Shield','','0.png'),(187,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Crokian Chief who rules Alligator Island. As a native Crokian who has lived in Innadril before humans and Elves came, he hates outsiders to protect his territory and tribe. Although he is not happy about Ateka of the snake family living on the same island, he cannot do anything about it because he is afraid of Water Dragon Fafurion. He is dreaming about the day when the Crokians can rule Innadril again with their own power.','0.png'),(188,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Devil living off the grudges and blood of innumerous ghosts wandering about in the Execution Ground. Standing at the center of the storm of hatred and grudges roaring in the Execution Ground, he is controlling other ghosts. There is a rumor that Ashtons excessive punishment and execution stem from this Evil Spirit Tempest.','0.png'),(189,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Double Dagger Attack','','0.png'),(190,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Wild Sweep','','0.png'),(191,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Convict Mercenary Captain wandering about to get secrets of the Cruma Tower. After listening to a bard singing a song called Seven Secrets of Cruma Tower, he\'s decided to officially become a knight of King by attaining the ancient weapon which is the third secret out of seven. Since Gatekeepers of the Ivory Tower have rejected his teleport as the Convict Tribe is banned from the tower, he still has not entered the tower, but has been circling around it.','0.png'),(192,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Unidentified Monster calling himself the first-ranking person, Premo Prime. Some say he was a product of Giants experiment, but no one knows where he came from, including himself. He has two heads, and one head calls itself Premo and the other is Prime. Unlike the name, he has very low intelligence.','0.png'),(193,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Puma Stun','','0.png'),(194,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 39','Leader of Cat Gang consisting of Servitors abandoned by their owners. They are known for attacking fresh fish just caught in the sea, and the Fishermen and Fish Traders\' Association has offered a lot of money for them. Many hunters went out to catch Cat Gang, but they could not kill the gang members and ultimately gave up the reward because of their cute looks.','0.png'),(195,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Eruption','','0.png'),(196,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Summon PC','','0.png'),(197,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Bear Stun','','0.png'),(198,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Wolf Stun','','0.png'),(199,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Ultimate Evasion','','0.png'),(200,'https://l2db.ru/themes/l2db/images/skills/skill4310.png','Strong Type','Monster whose HP is 9 times higher than normal.','200.png'),(201,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','none','','0.png'),(202,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Increase Re-use Time','Increases skill re-use time.','0.png'),(203,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decreases Speed','Temporarily reduces speed. Effect 3.','0.png'),(204,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease Heal','Reduces recovery magic.','0.png'),(205,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Toxic Smoke','Gradually decreases HP. Effect 2.','0.png'),(206,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 40','Lizardman mystic ruling Delu Lizardmen with superior insight and wisdom. He is known to have learned directly under Hardin. In the beginning, he considered peaceful co-existence with humans, but became angry at the stupidity of humans blindly treating them as hostile despite his continuous efforts. Now, he became a violent being who slays all the intruders in his tribe\'s territory.','0.png'),(207,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 40','A life form created by Icarus who is one of Hardin\'s disciples full of curiosity and playfulness during an experiment. Currently, Icarus has released it to test its behaviors and reactions on purpose, but it causes a nuisance to people.','0.png'),(208,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 50','Old Chief who has led Leto Lizardmen for the last tens of years. Despite his old age, he\'s survived thanks to his strong body and quick wit. After realizing that his tribe cannot take back their homeland if they directly fought against the powerful Aden Kingdom, he is watching for an opportunity. By using the coming confusion of the kingdom, he is trying to secure the territory of Leto Lizardmen.','0.png'),(209,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Crazy Chief who governed the Selu Orc Tribe. He has a certain degree of magic skills, but overestimates his ability so that he can call himself Shaman King. While experimenting several dangerous spells, he became crazy after his dangerous summoning failed. After leaving the hometown of the tribe, he has been ceaselessly wandering about along with his crazy subordinates, and attacking and murdering all the tourists.','0.png'),(210,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Evil Spirit born from Goddess Shilen\'s despair, curse and rage. Although he participated in the war with the Gods on the side of Goddess Shilen during the Era of Myths, he was greatly injured in the battle, and has been hiding out under the protection of Water Dragon Fafurion. Lately, he temporarily showed up in the world for propagation. He is Fafurion\'s subordinate, waiting for the day when Shilen and Evil Spirits dominate the world again.','0.png'),(211,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','As Water Dragon Fafurion\'s inferior, this is the Evil Spirit that knocked down innumerous disciples of the Gods while being called Sika of Storm during the war of the Gods in the beginning. He is a superior warrior and interesting storyteller at the same time. Currently, he is in charge of touring the world and telling stories at the command of Fafurion.','0.png'),(212,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Road Scavenger Leader that occupied Death Pass and threatens the Giran Territory. Being a coward by nature, Road Scavengers as well as their leader mainly attack the elderly or the leagues without guards that cannot defend themselves.','0.png'),(213,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Spirit of Water who was born with Innadrils strong water spirits and loved by Goddess Eva. Being reckless and giddy, he is good at evil tricks such as switching infants and causing floods in the middle of the night. Worried about revenge on Lian because of his thoughtless tricks, Eva gave him Guardian Spirits.','0.png'),(214,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','One of the Evil Spirits born by Goddess Shilen. After being largely scarred at the Gods\' war, it ran away to the earth and has been hiding out for thousands of years. It employs the family of Tasaba Lizardmen as its subordinates, and is waiting for the day when the goddess returns while feeling Shilen\'s power grows day by day.','0.png'),(215,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Brandish Queen Ant','','0.png'),(216,'https://l2db.ru/themes/l2db/images/skills/skill4018.png','Decrease Speed','Temporarily slows movement. Effect 3.','216.png'),(217,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Queen Ant','Vulnerable to fire attack but possesses great resistance against archery attack.','0.png'),(218,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 39','The spider that used to live in the Wasteland before Beleth was sealed. After Beleth was sealed, it was driven away by Ants whose power sharply grew thanks to the magic power in the Wasteland, and had to retreat to this place now. Swearing to overthrow the Ants someday, it is quietly growing its power and sharpening its blade of revenge.','0.png'),(219,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Flamestrike - Slow','','0.png'),(220,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 55','The latest version of Mechanical Golem that the Black Anvil Guild is desperately looking for. It recklessly ran because of a defective component that an artisan installed during the production by mistake. It partially destroyed the workshop, crushed many Dwarven Artisans who were trying to block it from running, and escaped the town. It is still wandering about in the woods without any destination, and attacking tourists passing by.','0.png'),(221,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A Crokian protecting the Land of Innadril since the ancient times. He is the native Crokian that has lived here before humans and Elves came to Innadril, and believes that Innadril has holy power unlike other territories. Watching the humans endlessly expand in the continent, he firmly decides to protect his ancestors\' land from them.','0.png'),(222,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 44','Taik Orc Chief Ranger who came down from the mountain to search for Deserter Bec who killed his colleague. Although he is treated as a ruffian or garbage chasing after a deserter among his tribe, he takes pride in his work and considers himself as someone who does necessary work for his tribe.','0.png'),(223,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 44','A monster plant grown on the poison in the Sea of Spores. It follows the Ruler of Sea of Spores, Orfen. It was given a task to kill invading humans by Orfen. Many of mystics who came from the Ivory Tower to check the magic force field preventing spores from spreading have been sacrificed by Rotting Tree.','0.png'),(224,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Immortal Knight sharpening his blade of revenge after losing his beloved to Orfen. With an adventurous sprit of youth, he partook in the Sea of Spores Troops along with his lover, but lost her due to Orfens plot and survived alone. After getting an immortal body for his revenge, he is searching for Orfen in the Sea of Spores.','0.png'),(225,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A by-product created by the ancient mystics of the Ivory Tower while they were investigating the Secrets of Infinite Flame contained in the flame stone and known to control the Spirits of Flame. It was considered as a failure and discarded, but it came to life again. Having wandered about near the Ivory Tower and interfering with innumerous Spirits of Flame, it has become the major headache of the mystics.','0.png'),(226,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Ratman Bandit who became famous for invading the guild of Hunters Village and stealing the Legendary Bow which is the guilds symbol. Unlike other Ratman Bandits, he has outsmarted many hunters of Hunters Village through his bold and elaborate plan. He is a legendary thief among Ratmen.','0.png'),(227,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 58','Pet of the genius mystic Sartune of Elmoreden who was sealed due to jealousy over his superior achievements. Living up to the reputation of Sartune\'s pet, it has superior intelligence and excessive playfulness, and is ruining the rural roads by controlling a large number of inferiors.','0.png'),(228,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 50','Silenos sacrificed in an experiment of the Ivory Tower\'s mystics. Due to the experiment, Shacram gained unnatural power, but his appearance was so disfigured that he could not return to his tribe. He moved to a deserted valley in the south with rugged mountain paths and a few people from the north of Oren, is hiding out. He extremely hates being exposed to other people, feels miserable about meeting his tribe again, and despises the mystics of the Ivory Tower who made him like this.','0.png'),(229,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Brave and great Tiger King. Despite his beast look, he rules the Silenos as his subordinates thanks to his divine nature and bravery. Originally, he was one of the Evil Spirits that Shilen created, but he has learned not to hate the Gods and endeavored to live up to his position as Tiger King after accumulating wisdom over the course of time. Among the Silenos Tribe, he accompanies Shamans as his inferiors.','0.png'),(230,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Iron Giant supposedly made by Devil Beleth. With the power to think by himself, he is a Golem made to manage other Golems. Due to Beleth\'s caprice, he was sealed on standby. While a long period of time had gone by, he has been worshiped as an idol by low-level Orcs who gathered near him. Currently, he is on the move after concluding that he\'s become the God of Orcs.','0.png'),(231,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','General-management artificial intelligence made to defend the Cruma Tower by Giants. It is a system that controls multiple upper-class Susceptors who are the guardians of the Cruma Tower to attack invaders.','0.png'),(232,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Savage Hero leading Timak Orc Warriors. Unlike Chertuba or Ragoth, he is a warrior who only knows fighting. Despite his strong power, he is not interested in anything but something to break with an axe. He is supported by many Orcs who do not understand Chertubas ideal or Ragoths wisdom.','0.png'),(233,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Evil Spirit that inherited the blood of powerful dragons among Shilens children. When the war of Gods concluded and the nation gained power, he was quietly sleeping underground. However, he woke up as the Time of Chaos began, and has ruled the entire Hunters Valley with horror. He is one of the biggest troubles for the Hunters Guild.','0.png'),(234,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Crokian Shaman who serves Water Dragon Fafurion. He assists Chief Sebek, and delivers Fafurion\'s commands to the Crokian Tribe. He uses the spell to control alligators on Alligator Island.','0.png'),(235,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Curve Beam Cannon','','0.png'),(236,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 43','Knight of Elmoreden who is the commander of the research squad investigating the Tower of Insolence by the command of General Karte. Like the general, he has an immortal body. As the right arm of General Karte, he is a brave knight who can even go to Hell if ordered. He received the powerful secret from Devil Rahha, and has been watching out and investigating Tirak who participated in the research squad given Rahha\'s warning.','0.png'),(237,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Immortal Warrior dispatched to protect the Seal of Antharas under the leadership of Watchman of the Land Dragon Antharas at command of Emperor Elmoreden. However, he was changed to a cruel monster that attacks anyone who approaches the Dragon Valley after straying away from the supervision of Watchman due to the influence of the dark magic prevalent in the area.','0.png'),(238,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Wind Fist','','0.png'),(239,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A foolish man who could not suppress his powerful yearning to learn the unknown knowledge that humans cannot attain, and tried to learn the dragons\' magic by visiting Land Dragon Antharas alone. However, Antharas turned the man into a monster for waking him up. Due to his ugly appearance, the man hates anything beautiful. He curses Antharas with his mouth, but has cowered away from the Land Dragon because he is afraid of the dragon.','0.png'),(240,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Riba following Arachne Orfen. Unlike other monsters living in the Sea of Spores, he has great intelligence and profound knowledge on magic. At the command of Orfen, he is looking for flaws of the Ivory Towers magic force field that blocks advancement of spores.','0.png'),(241,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC MP Drain - Magic','','0.png'),(242,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Orfen Heal','','0.png'),(243,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 49','Van Commander of the powerful Ketra Orc Tribe based in the Goddard Territory of Elmore Kingdom. He was dispatched to expand their influence to Aden Kingdom in the south. He greatly detests the Silenos as well as humans, and believes that the Ketra Orc Tribe is the most superior tribe.','0.png'),(244,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 49','General of Elmoreden who earned the immortal body based on a contract with Devil Kernon. With a rigid personality, he was opposed to the constructing of the Tower of Insolence, for which he was saved from Einhasad\'s rage. However, he\'s been suffering from losing his lord and country, and despises people in this world who betrayed his lord and built their own kingdom. As a loyal servant of the empire, he yearns for the day when he may get to appear in front of his king and serve him again.','0.png'),(245,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Devils Mirror that supposedly steals the soul of whoever looks into the mirror. Lords of Hell created it to collect souls in order to offer Gran Kain. It is hidden deep inside of the Forest of Mirrors and so many travelers lost their soul to this mirror.','0.png'),(246,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 50','One of the Peasant Leaders who resisted the outrages of the cruel and merciless Lord Ashton. He was ultimately captured and brutally executed by Ashton\'s punitive force. To take his revenge on Ashton, he made a contract with the Devil and came back to life. He once had noble ideals, but his hatred towards the nobles turned him into a monster. He now has the power of evil magic.','0.png'),(247,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 50','Messenger dispatched to Aden by Fairy Queen Timiniel in order to demand countermeasures on invaders of the Enchanted Forest. As one of the powerful warriors guarding the Fairy Queen, he has superior bravery and courage and is not afraid of anything.','0.png'),(248,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 45','Convict Mercenaries\' Captain from Grecia called Lord of Slaughter. As a powerful rival and colleague of Bloody Lord Nurka, he is greatly trusted by innumerous Convicts. Given his superb diplomatic skills, he has established friendship with many Great Nobles and high-ranking officials. As much as these nobles are using his tribe, the Convicts, he is setting up a plan to go back to his homeland, Grecia by using them back.','0.png'),(249,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','She was a beautiful lady of a respectable family since her birth, but turned into Medusa after making Einhasad angry due to her excessive arrogance. After failing to accept her ugly looks and lost past, she became a brutal monster that takes her anger out on people near her. She even turned her fianc?who couldn\'t forget about her into stone and broke it down. She is not a beautiful lady anymore, but a monster.','0.png'),(250,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Queen of Elves who was wise enough to decide to teach humans magic. After the war with Orcs, she was murdered because of the humans\' betrayal, but resurrected by Lilith. She then became the ruler of the Catacomb. She was knocked down by Anakim who invaded the Catacomb, but came back to life thanks to the power of Seal Stone as the Seven Signs Seal was broken. She\'s lost most of her rationality, and fought only to protect the Seal Stone, waiting for the time of rest.','0.png'),(251,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Subordinate of Pirate King Zaken. He was the one who instigated the crew members and raised the riot on the ship when Zaken taught him the location of treasures. When Zaken came back to life in an immortal body, he was killed first. Later on, he was resurrected and entrusted with the duty to kill any invaders on Devils Isle.','0.png'),(252,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Orfen','Vulnerable to fire attack but possesses great resistance against archery attack.','0.png'),(253,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Become weak against line of fire.','Resistance to fire falls.','0.png'),(254,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 55','As Devil Kernon\'s confidant, he is a combative devil that overpowers the opponent with his strong power and gigantic body. Currently, he is investigating the inside of the Tower of Insolence at Kernon\'s command. Being a combative devil, he is simple enough to believe that promotion of his superior Kernon will lead to his advancement.','0.png'),(255,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Knight of Name from Oren who served in the war to kill monsters in the Forest of Mirrors. But, his troops failed and he was eventually sacrificed by the mirror, too. Now, he forgets about the past and wanders about in the woods with his soul stolen.','0.png'),(256,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 48','Red Flag Leader of the Oel Mahum watching for an opportunity to take over the Bandit Stronghold. He is greatly proud of being an Oel Mahum. Although he is smart, hearty and brave, his power is somewhat weak because he is young. He is still growing his power. He boasts that he will build a kingdom of Oel Mahum as soon as he takes over the stronghold.','0.png'),(257,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Orc Warrior who invaded the Cemetery according to High Prefect Araks Aden Castle attack plan. Due to the fight against monsters of the Cemetery, he was having difficulties in receiving supplies. Thus, he began robbing graves to overcome the supply shortage, and earned his nickname, Grave Robber Kim.','0.png'),(258,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Messenger of Water Dragon Fafurion sent to Goddess Eva to complain his mortification. After Goddess Eva stops visiting the Garden of Eva, he loses his original purpose, stays there and guides invading Stakatos.','0.png'),(259,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Self Damage Shield','','0.png'),(260,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 53','Mutant of the powerful Monster Eye. Some call it the final feature of Monster Eye\'s evolution. It has superior intelligence and strong pride. It ran away from Argos, the father of all Monster Eyes, to the south, but has the ambition to grow its power and take over the power of Argos someday. It believes that it gets stronger by eating the brains of other intelligent living things.','0.png'),(261,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Dark Mage who assisted Pirate King Zaken. By leaking a story that the Cruma Tower had the secrets of immortality hidden inside, he made Zaken travel to the Cruma Tower. He was murdered by the curse of Zaken who thought the Dark Mage lied, and became a ghost. Some says that it was because of the dark magics reflective reaction. Originally, he was the follower of Beleth under the leadership of Devil Kurikups.','0.png'),(262,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A unicorn aimlessly drifting along after losing its nest since the Era of Myths that ended upon rage against Einhasad\'s Titan. The unicorns are searching for their lost homeland. The leader of the unicorns has lost its group while roaming about from place to place, and been alienated. Although it is still desperately looking for its group, hundreds of years have passed since it parted ways from its group. Being alone, it still has not adapted itself to the human world.','0.png'),(263,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Eruption - Slow','','0.png'),(264,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Nurka Blaze','','0.png'),(265,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 55','Treant who lived in the south of Gludio loved trees and nature. At war with Beleth, he entirely lost the beautiful forest where he was living and all his friends. Due to the shock from the experience, he is a prisoner of revenge and hateful madness. To this day he is still fighting against humans and mystics.','0.png'),(266,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 55','Treant Guardian protecting the outskirts of the forest at command of Enchanted Forest Queen Timiniel. He hates intruders disrupting peace in the forest, and never forgives anyone who violates the Forest Law. With the power given by Queen Timiniel, he summons Sylphs and Unicorns, and protects the Enchanted Forest.','0.png'),(267,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 55','Powerful Shaman greatly respected by Lizardmen. Currently, he is hiding out in a corner of the plains. He resents that humans continue to take away Lizardmen\'s territory where they\'ve lived since ancient times. He also hates humans attacking Lizardmen that live in peace.','0.png'),(268,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 55','A woman who entered into a contract with Devil Beleth for power. Thanks to Beleth\'s teaching, she gained the power of a powerful mystic. She is searching for Beleth\'s historical site supposedly hidden somewhere underground of the south Gludio Wasteland, and preparing for a secret ritual to resurrect him.','0.png'),(269,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Dark Elf Witch who got her power through a contract with Demon Kurikups while living on Devil\'s Isle. Originally, she was a witch who wanted to live peacefully with humans, but began hating humans after failing to overcome prejudice and misunderstanding she received from the human world.','0.png'),(270,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Harit Lizardmen\'s best warrior. Being quiet and reliable, he is a perfectionist who never gives up on his task and carries it out to the end. After being entrusted with the duty to guard the Holy Land, he has protected Harit Lizardmen\'s holy land, Anghel Waterfall, fighting off so many monsters and devils.','0.png'),(271,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Executioner that killed the crew members who didn\'t obey under the leadership of Great Pirate Zaken. Ironically, it was also him that decapitated Zaken during the riot. After coming back to life as an Undead due to the Captain\'s Curse, he swore not to disobey the Captain\'s command, and has protected Zaken\'s treasures at the Tunnel of Pirates.','0.png'),(272,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Convict Soldier sent by Einhasad for his daughter, Anakim, after watching her struggle at the battle with Lilim. The most brave Convict at the time was called in and given the golden armor with the strong power. He may be the beginning of the Platinum Tribe of today. He always assisted Anakim by her side during the battles, but eventually got killed by a heathen in the Catacomb. When the Seal of the Seven Signs was broken, he woke up again after feeling the power of Einhasad that was sleeping in the Seal Stone.','0.png'),(273,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Oel Mahum Warrior competing against other leaders of the bandits over Orens Bandit Stronghold. He cannot personally perform spells, but has profound knowledge about magic and spells and leads superior Shamans as his inferiors. As an Oel Mahum, he is rather prudent and timid.','0.png'),(274,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Knight who distinguished himself in war and died at the battlefield during the war with Elmore Kingdom long ago. He lost the rest of his soul and woke up when monsters and devils that invaded the Cemetery stirred up troubles due to the weakened management caused by the domestic confusion. He attacks not only the devils who woke him up, but also any living things entering the Cemetery.','0.png'),(275,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','This is the spirit that manages the Garden of Eva if Millenu is the guardian of the garden. It is in charge of maintaining the inside neatly and comfortably for the times when the goddess comes to rest.','0.png'),(276,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Solar Flare','','0.png'),(277,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 58','Grecia\'s Oel Mahum Great Noble who could not return to his country after losing in the Aden-Grecia War. He got lost while he was searching inside of the Cruma Tower with the troops that marched up to the tower during the war, and accidentally got to have a few Titans as his subordinates inside of the tower. When he finally escaped from the tower, the war was already over, and he was left with an enormous reward on his head and a few subordinates. Presently, he is desperately trying to flee to the Elmore Kingdom in order to survive.','0.png'),(278,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Combative Golem of Titan made to prevent anyone from invading the Cruma Tower or to prepare for another war of the Gods in the future. So far, it is waiting for the sally order from Titans that may never come in the basement of the Cruma Tower along with a few bio weapons.','0.png'),(279,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Queen off all the fairies who have ruled the Enchanted Forest for thousands of years. Living up to the title of being the queen of fairies, she is capricious and cranky. She is nervous about the Seal of Shilen gradually weakening.','0.png'),(280,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Son of Fierce Tiger King Angel called Guardian of Harit Lizardmen. The king sent his son, Garangky, as the guardian of Lizardmen to Harit Lizardmen who had protected Anghel Waterfall generation after generation to express gratitude for their work.','0.png'),(281,'https://l2db.ru/themes/l2db/images/skills/skill4300.png','Race','Giant','281.png'),(282,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Seer who served Chertuba of Great Soul. He was also a hero who led the Timak Orcs and built the Timak Outpost of today when he was young. Thanks to the power of totems, he has a far longer life than general Timak Orcs. After old Chertuba went mad, he is practically running all the Timak Orcs at present.','0.png'),(283,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 59','With its soul taken away by an evil mystic\'s experiment, this beast turned into a killing machine. The mystic that took its soul was eventually killed by this wild boar. It is looking for a strong entity that can rest its soul at peace.','0.png'),(284,'https://l2db.ru/themes/l2db/images/skills/skill4306.png','Strong Type','Monster whose HP is 5 times higher than normal.','284.png'),(285,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 60','Mechanical Golem owned by the Lord of Innadril Castle whose family has been protected by Eva for generation after generation in order to protect the Garden of Eva. It was made by Dwarven Artisans with the best skills in the kingdom. It is the guardian to block Fafurion\'s troops or invaders threatening the garden. No. 1 and No. 2 were built, but only the final improved model No. 3 is left.','0.png'),(286,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A failed weapon created by mystics of the Ivory Tower for fear of Devil Beleth\'s resurrection. Although he was modeled after a Titan\'s looks, he didn\'t even follow the creator\'s command, acted in his own way and eventually escaped the tower. While looking for a life form similar to himself for a long time, he discovered and investigated relics of the ancient Giants, and concluded that he was the only true Titan that survived the disaster in the past. He is dreaming about his revenge on the Gods who made the Titans fall.','0.png'),(287,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Titan called in by Great Pirate Zaken through using the giant\'s legacy discovered in Cruma. Since Zaken doesn\'t trust his inferiors as he was murdered by his inferiors for money before, Titan is in charge of guarding the treasures instead.','0.png'),(288,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','High Prefect of Taik Orcs who occupied the Cemetery to attack Aden Castle, and turned it into his outpost. He has tried an all-out surprise attack by leading a small number of elite soldiers and the supply troops, but cannot do anything due to complicated interests of other monsters who already built a nest. He hates humans who killed Orcs and destroyed their kingdom in the past.','0.png'),(289,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A noble that led the Antharas expedition with the Land Dragon Punitive Force during the time of Elmoreden Kingdom. Due to his foolishness, the entire force was killed and he was also sacrificed to the claw of the Land Dragon. To laugh at his stupidity, Antharas resurrected Ishka, and put him in charge of protecting the Dragon Valley.','0.png'),(290,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Scatter Enemy','','0.png'),(291,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Absorb HP MP','','0.png'),(292,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Deadly Two-Sword Weapon','','0.png'),(293,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Deadly Two-Sword Weapon: Range Attack','','0.png'),(294,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Instant Move','','0.png'),(295,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Buff - Acumen Shield WildMagic','','0.png'),(296,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Clan Buff - Acumen Empower WildMagic','','0.png'),(297,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Blazing Circle','','0.png'),(298,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC AE Solar Flare - Magic','','0.png'),(299,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC AE Solar Flare - Slow','','0.png'),(300,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Buff - Acumen Empower Berserk','','0.png'),(301,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Super Strike','','0.png'),(302,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','AV - Teleport','','0.png'),(303,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Oel Mahum Lord who owned a Bandit Stronghold once. Fed up with the repeated competition, he came out of the stronghold along with his inferior seers and prefects, and is looking to take back the stronghold.','0.png'),(304,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Buff - Acumen Empower DamageShield','','0.png'),(305,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 63','Originally, he was a Shaman of the village, but looked the other way due to threats after witnessing Elmore invaders put poison in the well. Watching the villagers die one by one, he realized what he\'d done and became crazy. He still appears around the well, and recklessly attacks anyone who comes close, thinking that they are Elmore soldiers.','0.png'),(306,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Eruption - Magic','','0.png'),(307,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Buff - Acumen Empower WildMagic','','0.png'),(308,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC MR - Twister','','0.png'),(309,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Buff - Acumen Berserk WildMagic','','0.png'),(310,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Straight Beam Cannon','','0.png'),(311,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Curve Beam Cannon - Magic','','0.png'),(312,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Buff - Acumen Berserk DamageShield','','0.png'),(313,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A living organization improved based on Monster Eye by Giants who ran away to avoid Einhasads rage and beat the pursuers of the Gods. After the punishment of the Gods was over, the one that turned its teeth to Giants who were at peace was Gorgolos that they had created.','0.png'),(314,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 65','Loyal Guardian protecting the Garden of Eva, Goddess Eva\'s resting place. It\'s been a long time since the goddess stopped visiting the garden, but he still stays here to watch out for reckless invaders entering the holy goddess\'s resting place, and protects this place.','0.png'),(315,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 65','The staff of Death Lord Hallate with smart intelligence and beautiful appearance. Currently, she is working as Devil Kernon\'s subordinate in charge of Tower of Insolence. She is Hallate\'s confidant and lover. Sensing Devil Kernon\'s intention of betrayal, she is quietly monitoring him.','0.png'),(316,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC AE Strike','','0.png'),(317,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 65','A gigantic tiger of legend that rules Anghel Waterfall. Originally, it used to be a holy god-like creature guiding angels in the heavens, but bit its owner to death and ran away to the earth. Currently, it is hiding out in Anghel Waterfall. Despairing of its downgraded position and miserable life, it has become violent and devours any tourist or reckless adventurers passing by.','0.png'),(318,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A type of mental control device created by the ancient giants\' civilization. This was a device that giants made to rule other intelligent life forms, but it is conversely controlling the giants degenerated as slaves after the giants\' civilization collapsed. Similar to Core in the Cruma Tower, it is a life form with artificial intelligence that can control all the degenerated servants nearby.','0.png'),(319,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A devil and Beleth\'s inferior living on Devil\'s Isle. After Beleth disappeared from the world, this devil stopped his activities on his own and has been taking a long vacation. When the pirates occupied Devil\'s Isle and became noisy, he woke up and regretted that he didn\'t wipe out the pirates from Devil\'s Isle before Zaken became immortal. He is waiting for his owner, Beleth, to come back again and give him commands.','0.png'),(320,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Leader of Weird Drake. He is the oldest Weird Drake who has discouraged so many hunters. It is not exaggeration to say that the history of Hunters Village is connected to fights against him. He has fought and murdered so many hunters and despises all hunters.','0.png'),(321,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Leader of Ancient Gargoyles who were the first born Gargoyles. During the war of the Gods, he led Ancient Gargoyles and fought against the Gods on the side of Shilen, but lost. Now, he is hiding out on the Forsaken Plains. He is sharpening his blade of revenge, waiting for Shilen, Mother of Evil Spirits, to be resurrected.','0.png'),(322,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Priest Falibati following Queen Themis. He serves Goddess Shilen, and introduces the queen as one of Queen Shilens fragments that descended to the earth. He is waiting for the day when the Seal of Shilen is completely broken, and continuously performing the ritual to dedicate the blood of pure and innocent ones to the Seal of Shilen.','0.png'),(323,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Reducing P.Def Shock','Instantly decreases P. Def. and gets shocked so that one\'s target cannot move temporarily. Effect 1.','0.png'),(324,'https://l2db.ru/themes/l2db/images/skills/skill1013.png','Recharge','Restores one\'s MP. Power 49.','324.png'),(325,'https://l2db.ru/themes/l2db/images/skills/skill1048.png','Bless the Soul','Temporarily increases maximum MP. Effect 1.','325.png'),(326,'https://l2db.ru/themes/l2db/images/skills/skill1059.png','Empower','Temporarily increases M. Atk. Effect 1.','326.png'),(327,'https://l2db.ru/themes/l2db/images/skills/skill1078.png','Concentration','Temporarily lowers the probability of magic being canceled due to damage. Effect 1.','327.png'),(328,'https://l2db.ru/themes/l2db/images/skills/skill1085.png','Acumen','Temporarily increases Casting Spd. Effect 1.','328.png'),(329,'https://l2db.ru/themes/l2db/images/skills/skill1160.png','Slow','Temporarily reduces target\'s Speed. Effect 2.','329.png'),(330,'https://l2db.ru/themes/l2db/images/skills/skill1204.png','Wind Walk','Temporarily increases Speed. Effect 1.','330.png'),(331,'https://l2db.ru/themes/l2db/images/skills/skill1263.png','Curse Gloom','Curse that decreases enemy\'s M. Def. Effect 3.','331.png'),(332,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','General Construction Manager in charge of building the Tower of Insolence at command of Emperor Baium. When completion of the tower was continuously delayed, he was executed by the order of the enraged Emperor. After being killed unfairly, he came back to life thanks to the Energy of Life pouring out after the Tower of Insolence collapsed. Owing Baium a grudge, he is wandering about near the Tower of Insolence to take his revenge.','0.png'),(333,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Hex','Instantly decreases enemy\'s P. Def. Effect 3.','0.png'),(334,'https://l2db.ru/themes/l2db/images/skills/skill1044.png','Regeneration','Temporarily increases HP recovery. Effect 1.','334.png'),(335,'https://l2db.ru/themes/l2db/images/skills/skill1045.png','Bless the Body','Temporarily increases maximum HP. Effect 1.','335.png'),(336,'https://l2db.ru/themes/l2db/images/skills/skill1086.png','Haste','Temporarily increases Atk. Spd. Effect 1.','336.png'),(337,'https://l2db.ru/themes/l2db/images/skills/skill1206.png','Wind Shackle','Spirit of the Wind attacks, reducing target\'s Atk. Spd. Effect 1.','337.png'),(338,'https://l2db.ru/themes/l2db/images/skills/skill1217.png','Greater Heal','Restores HP. Power 371.','338.png'),(339,'https://l2db.ru/themes/l2db/images/skills/skill1240.png','Guidance','Temporarily increases Accuracy. Effect 1.','339.png'),(340,'https://l2db.ru/themes/l2db/images/skills/skill1268.png','Vampiric Rage','Partially restores HP using damage inflicted upon the enemy. Excludes damage from skill or remote attack. Effect 1.','340.png'),(341,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Buff - Acumen WildMagic DamageShield','','0.png'),(342,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC AE - Dispel Silence','','0.png'),(343,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Death Link','','0.png'),(344,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','The last Giant hiding deep inside of the Giants Cave. Although his body is nothing better than that of other Lesser Giants, he has the secrets of the Ancient Giants civilization inside of his head, and protects them.','0.png'),(345,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Elmores Noble dispatched by Devil Triols followers to steal Grail of Shine which is Einhasads relic. He was an excellent knight in his lifetime, but became a vampire after selling his soul to Devil Triol for eternal life and power.','0.png'),(346,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC AE - Dispel Hold','','0.png'),(347,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC AE - Dispel Slow','','0.png'),(348,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease P.Def','Reduction in P.Def. Effect 1.','0.png'),(349,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Clan Buff - Acumen Empower Berserk','','0.png'),(350,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Fast Wind Fist','','0.png'),(351,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Monster Dragon known to have come out of Goddess Shilen\'s nightmare. However, it is one of the Spirits of Darkness rather than a monster directly born to Shilen. It is more like a Shadow summoned by necromancers. While living on earth, it took the form of a dragon which living things were most afraid of.','0.png'),(352,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Brother of Falibati Queen Themis. He was sent to Maruk for the price of Themis\' running devils. Due to the contract with Antharas, he is in charge of summoning other Maruk devils at Dragon Valley. However, he is jealous of Themis for having a deep relationship with the world of darkness because he is not a resident of the world of darkness where Maruks belong.','0.png'),(353,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC 100% HP Drain','','0.png'),(354,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC AE - Corpse Burst','','0.png'),(355,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Straight Beam Cannon - Magic','','0.png'),(356,'https://l2db.ru/themes/l2db/images/skills/skill4308.png','Strong Type','Monster whose HP is 7 times higher than normal.','356.png'),(357,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Commander in charge of the castle destroyed during the war between Elmore and Aden. He made a mistake by letting his Elmore friend come inside the castle during the war. After losing the castle and his people because of the poison that his friend put in the well, he was too mortified to forget the betrayal, and became a ghost wandering about near the destroyed castle.','0.png'),(358,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 69','Creature of Land Dragon Antharas. By its creator, it was entrusted with the duty to protect the Dragon Dungeon, and eliminate uninvited guests who try to wake up the Land Dragon from a deep sleep. Due to his body stained with the blood of intruders killed over the years, he is called Bloody Priest Rudelto.','0.png'),(359,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Giant Wyvern living in the Blazing Swamp. He is the leader of Wyverns and River Wyrms in the Blazing Swam, arguing that the entire Blazing Swamp is Wyverns territory. He is not happy about the influence of devils that have invaded the Blazing Swamp.','0.png'),(360,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Archangel who came down to keep the Grail of Shine which is the relic of Einhasad, God of Light. He does not show his existence on the surface, but watches movement of devils vigorously conducting activities in the Elmore Kingdom.','0.png'),(361,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','King of Bloody Lords summoned by Marilion. After predicting Nephilim military power to attack, Marilion prayed to Shilen and summoned the king. By killing so many Nephilim, he gave a big blow to the Army of Light. Eventually, he was driven back by Anakim who personally came to fight along with her inferiors, Nephilim, and ran away to the Necropolis.','0.png'),(362,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','King of Beasts who was captured alive for Emperor\'s entertainment during the golden years of Elmoreden and waited for the day of death in Coliseum. When the kingdom fell apart, mystics who were afraid of his grudge and escape sealed him underground of the Coliseum, but he escaped later when the seal weakened. The superhuman power coming from his gigantic arms can shatter any rock into pieces, and he can rule all the beasts as his subordinates.','0.png'),(363,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Queen of Falibati protecting the Seal of Shilen. She is one of the monsters that Shilen gave birth to during the war of the Gods, and her authority nearly equals that of Death Lords. She summons the dead and devils to rule them as her servants, and even employs the low-level devil, Succubus, as her maid. According to Shilen\'s Priest Hisilrome who is also a Falibati, Themis is a piece of Shilen, the queen of Evil Spirits, who came down to this land.','0.png'),(364,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A messenger of Fafurion. This drake, Loch Ness, whose ancestor is the Water Dragon Fafurion, delivers messages from Fafurion to Lizardmen and Crokians. Since Fafurion is not interested in these two weak tribes, Loch Ness handles them at its discretion. It despises creatures weaker than it is.','0.png'),(365,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Drake that used to be a guardian of Aden Territory since ancient times, but turned into a devil of revenge after losing his child to a greedy hunter. Getting out of the Dragon Valley where he used to live, he has wandered about in territories near Aden Castle, and killed innumerous civilians. He also killed all the priests who came to calm his rage down, becoming the horror of all Aden residents. All of his good work done by Imperial command has been erased in history, and he is now called the Disaster of Aden only.','0.png'),(366,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 70','Expelled Heltor Silenos Leader. He is a fanatic of Baium, and believes that Baium must be resurrected to wipe out all other tribes holding the flow of the continent at present through Baium\'s power. Due to his extreme arguments, he was expelled from his tribe. However, he is still promoting the plan to resurrect Baium around the Tower of Insolence along with his followers after failing to give up on his idea.','0.png'),(367,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 70','Reaper, the page of Goddess of Death Shilen, in charge of collecting innumerous souls wandering about on earth and bringing them to the underground world where Shilen lives. His loyalty to Shilen is absolute, and he stays close to the Seal of Shilen in order to serve the goddess at a close distance. He restlessly carries out his duty, waiting for the day of the goddess\'s resurrection.','0.png'),(368,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC AE - 80% HP Drain - Magic','','0.png'),(369,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','The oldest son of the Von Hellman Family that was exterminated for treason. He was a superb warrior, but killed along with his whole family before he could shine. Through a contract with devils after his death, he became alive again as a vampire, and has wandered about in the Forest of the Dead even now, dreaming about his revenge.','0.png'),(370,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Mystic that assisted Emperor Baium by his side. To study the secrets of eternal life at the command of the Emperor, he promoted construction of the Tower of Insolence. As a result, he made Einhasad angry and got killed by Angels. However, he came back to life when the Angels went away because he already knew the secrets. Now, he is working to resurrect Baium.','0.png'),(371,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Hate','','0.png'),(372,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Great Seer of Virud Lizardmen, he is an enthusiastic adherent of Fafurion. Being a powerful Shaman, he believes that Water Dragon Fafurion will lead Lizardmen to the day of glory someday, but Fafurion is not interested at all.','0.png'),(373,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Vanor Silenos Chief. The owner of the Plains of Glory in the east of Aden. During the years of Unification King Raul, he had a peace treaty with humans, and enjoyed a bucolic life. But, in the time of war disturbances, he has raised his sword and prepared for war by gathering the Vanor Silenos Tribe. Considering the tribe\'s characteristics to love peace and hate fights, he may not be harmful, but a rumor says that Unification King Raul proposed the peace treaty in a hurry because he was afraid of Kandra\'s swordsmanship.','0.png'),(374,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Commander of the Undead wandering about on the battlefields of the past. He was a general who led an army called Death Blade in the past and slaughtered anything visible. Owing to the petition of the nobles who were afraid of his madness, he was demoted, and later killed with his army in a battle in which he was used as bait. However, even death could not stop his madness for slaughter. He called upon the magic of darkness, and resurrected himself and his army as the Undead. He still threatens the Frontier Post with a shiny blade that never gets rusty.','0.png'),(375,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Clan Heal','','0.png'),(376,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Leader of devils trying to occupy the Tower of Insolence. To obtain the secret knowledge hidden in the Tower of Insolence and use it as a bridgehead to expand the power of devils, he is aiming at the Tower of Insolence. To break a seal of the Tower of Insolence, he spent too much power, and became weak at the moment. He has a hostile relationship with angels protecting the Tower of Insolence at the command of Einhasad and the Platinum Tribe working for the angels. He has 3 loyal subordinates: Kernon, Rahha and Verfa.','0.png'),(377,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Solar Flare - Slow','','0.png'),(378,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Clan Buff - Berserk Might','','0.png'),(379,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Clan Buff - Haste','','0.png'),(380,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 74','Witch of a heretical religion who serves Antharas and sacrifices herself. She uses the dark magic on herself and obtains the body of a powerful evil spirit. By using her Servitors, she attacks invaders interfering with Antharas\' sleep. Through a life of slaughter repeated for a long time, she\'s now become a perfect evil spirit that enjoys eating human hearts with warm blood.','0.png'),(381,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Emperor of Crokians living on Alligator Island and entire Innadril Territory. Calling himself Padisha, he has elite bodyguards under his direct supervision. Although he is not happy about many Crokians following the Water Dragon, he does not dare challenge Fafurion.','0.png'),(382,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Leader of Mineral Spring Yetis living in the hot spring area. He is arrogant enough to call himself Icicle Emperor, but is in fact a coward. He marched into Fire Dragon Valakas nest once to prove his strength, but got scared and ran away when he saw Valakas sleeping. He is extremely afraid of Valakas, and runs away out of horror if he hears a roaring sound.','0.png'),(383,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Sacred Attack','Launches a sacred attack.','0.png'),(384,'https://l2db.ru/themes/l2db/images/skills/skill4337.png','Resist Sacred Attack','Provides powerful resistance against sacred attack.','384.png'),(385,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Clan Buff - Vampiric Rage','','0.png'),(386,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 75','As Death Lord Hallate\'s subordinate, he is collecting information related to the secrets hidden in the Tower of Insolence. He is waiting for the position of Death Lord Hallate exhausted from the battle against Baium. He has the contract with General Karte of Elmoreden to use him.','0.png'),(387,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Inferior of Wind Dragon Lindvior. While fighting against the Gods with other dragons during the War of the Gods, he hid in Oren Forest and fell asleep after getting severely injured. Lately, he woke up after feeling the power of Shilen coming out of the Tower of Insolence. He is slightly smaller than a general drake, but his quick movement makes others confuse him with the Wind Dragon.','0.png'),(388,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Lesser Titan discovered in the Giants Cave. Due to his superior combat power, some scholars were questioning if it is not a Lesser Titan at all, but a real Titan. They named him Last Lesser Giant Olkuth.','0.png'),(389,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Plant-shaped Monster emerging near the Tower of Insolence. A giant tree growing near the Tower of Insolence mutated due to the energy of the seal flowing from the tower and Death Lord Hallate\'s power of darkness, and became an enormous monster. It sucks the energy of the seal from the upper stream connected to Oren Castle, and attacks adventurers headed for the Tower of Insolence at command of Hallate.','0.png'),(390,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','A girl buried alive after being captured during the war despite being a daughter of a noble family in the Elmore Kingdom. Due to her powerful spirit created by the fear of slowly dying, she summoned a devil and entered into a contract. Through the contract, she obtained the power to resurrect the buried girls as Bloody Queens. She hates her parents who gave her up and those who buried her.','0.png'),(391,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Powerful Death Lord that came up from Purgatory upon request from Death Lord Hallate. Unlike Hallate who spent most of his power on breaking the seal of the Tower of Insolence, he has reserved most of the power from Purgatory. Rather than taking direct actions, he enjoys causing confusion through conspiracies and plots. Currently, he is observing the situation near Aden Castle. He seems to have some kind of relationship with the upper-class nobles of Aden Kingdom.','0.png'),(392,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Powerful Death Lord that came up from Purgatory upon the request of Death Lord Hallate. Unlike Hallate who spent most of his power on breaking the seal of the Tower of Insolence, he has reserved most of his power from Purgatory. Unlike Death Lord Ipos, he does not have a relationship with humans, or acts alone without listening to Hallate. Finding pleasure out of slaughtering and massacring, he lives on the Killing Ground at present, and spreads the spirit of purgatory and death.','0.png'),(393,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Baium: General Attack','','0.png'),(394,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Wind Of Force','','0.png'),(395,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Earthquake','','0.png'),(396,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Striking of Thunderbolt','','0.png'),(397,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Shock','Paralyzed so that it cannot move temporarily.','0.png'),(398,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease P.Atk','Reduction in P.Atk. Effect 1.','0.png'),(399,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Einhasad\'s Messenger who came down to monitor behaviors of Water Dragon Fafurion. Since he lost many colleagues to Fafurion during the Heaven War, he hates Fafurion. Because the Gods prohibit him from attacking Fafurion, he is not conducting any direct action.','0.png'),(400,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Quest - Summoned HP Heal','','0.png'),(401,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Quest - Summoned MP Heal','','0.png'),(402,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Curse of Vague','Temporarily decreases Speed and Accuracy significantly. Guidance spell can remove the curse.','0.png'),(403,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Curse of Weakness','Temporarily decreases P.Def and Speed significantly. Shield spell can remove the curse.','0.png'),(404,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Curse of Nihil','Temporarily decreases P.Atk, M.Atk and Atk.Speed significantly. Might spell can remove the curse.','0.png'),(405,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Dance of Resist','Temporarily decreases Speed and Accuracy significantly. Dance of Inspiration can remove the curse.','0.png'),(406,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Dance of Nihil','Temporarily decreases Atk.Speed and Evasion significantly. Dance of Fury can remove the curse.','0.png'),(407,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Dance of Weakness','Temporarily decreases P.Def and P.Atk significantly. Dance of Vampire can remove the curse.','0.png'),(408,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Song of Seduce','Temporarily decreases Speed and Accuracy significantly. Song of Wind can remove the curse.','0.png'),(409,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Song of Sweet Whisper','Temporarily decreases Atk.Speed and Evasion significantly. Song of Water can remove the curse.','0.png'),(410,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Song of Temptation','Temporarily decreases P.Def and P.Atk significantly. Song of Vengeance can remove the curse.','0.png'),(411,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Quest BOSS Big Body','','0.png'),(412,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Quest BOSS Dispel Big Body','','0.png'),(413,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Quest - BOSS Evasion','','0.png'),(414,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Quest - BOSS Bluff','','0.png'),(415,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Van Leader of angels that punished Baium and broke down the Tower of Insolence. He is actively participating in blocking devils that smashed through the upper floors of the Tower of Insolence. Leading Kel Mahums of the Platinum Tribe, he is still at war against devils for the seal of the Tower of Insolence. He is called Fire of Wrath because his sword of judgment does not have any hesitation, compassion or mercy at all.','0.png'),(416,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','The one that protects the Divine Statue of Giants which is the Relic of Giants deep inside of the Giants Cave. No one knows what the statue means or why it is desperately protected.','0.png'),(417,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Gigantic Monster Eye created by God of Light Einhasad with his dark side to punish the arrogance of Giant Argos. It is located in the Wall of Argos against Argos, controlling evil monster eyes in order to completely remove the eyes of Argos, the other half, and ultimately rule the world.','0.png'),(418,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Servant of Fairy Queen dispatched to protect the hot spring, a resort that Fairy Queen Timiniel loves. Despite his power next to Queens power, he feels sorry for himself because he has to protect a mere hot spring. With too much time left for nothing to do, he plays with tourists passing by, but the problem is that his play is not something that humans can endure.','0.png'),(419,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Spear: Pound the Ground','','0.png'),(420,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','BOSS Lilim Drain','','0.png'),(421,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level 80','As one of Elmoreden\'s 4 Kings, the powerful and gigantic Minotaur used to be a servant of Baium, but he is now under Death Lord Hallate. To carry out a promise of long long ago, he is locked inside the top floor in the Tower of Insolence, waiting for the resurrection of Baium. Having equally matched battles with Fire of Wrath Shuriel, the leader of angels, he is watching for the influence of angels and the Platinum Tribe.','0.png'),(422,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Leader of Angels that protect the Tower of Insolence and Baium, leading Fire of Wrath Shuriel and innumerous Angels. He is the direct-descendant Cherub of Einhasad, God of Light.','0.png'),(423,'https://l2db.ru/themes/l2db/images/skills/skill4108.png','Terror','Tremble with fear and run away aimlessly.','423.png'),(424,'https://l2db.ru/themes/l2db/images/skills/skill4109.png','Curse of Antharas','Receive the curse of Antharas.','424.png'),(425,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Mouth Odor Attack','','0.png'),(426,'https://l2db.ru/themes/l2db/images/skills/skill4111.png','Fossilization','Body becomes like stone and can\'t move.','426.png'),(427,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Ordinary Attack','','0.png'),(428,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Animal doing ordinary attack','','0.png'),(429,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Antharas','Vulnerable to wind attack but has very powerful resistance against earth and shock attacks.','0.png'),(430,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Magma Attack','','0.png'),(431,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Fire Weakness','Decreases resistance to fire. Effect 1.','0.png'),(432,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Owner of Necropolis called Holy Mother of Darkness waiting for Shilens resurrection. She used to be First Titans oracle who served the Goddess of Water Shilen. After Shilens fall, she was ordered to prepare for Shilens resurrection and left on earth when the goddess hid herself inside of death created by the goddess. She received a new body, secretly instigated humans and Elves, caused so many wars, and resurrected those who died at the battlefields to make her soldiers. She is Shilens loyal servant who would do anything to resurrect Shilen.','0.png'),(433,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','BOSS Holy Light Burst','','0.png'),(434,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Angel that showed up before the first emperor Shunaiman to overcome the crisis of Shilens children. She is called Flame of Sacred Flame or Einhasads Messenger. As the Leader of Light that descended on the ground, she led Nephilim and jumped into Necropolis to dislodge Lilim led by Lilith, but got sealed with Lilith. She looks like a beautiful and innocent girl, and is the mortal enemy of Lilith.','0.png'),(435,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Orc Soldier who is Commander Tayr\'s right arm and respected by so many Ketra Orc Warriors. Using a large axe called Divider, he became the leader of horror that has taken innumerous Silenos lives. Silenos are more afraid of him than Commander Tayr.','0.png'),(436,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','Shaman who is a Great Sage called Varka Silenos Hope. He prophesied that the future of Varka Silenos was in the land of Goddard, and persuaded Chief Horus to lead Silenos to the Goddard land. Against the powerful Ketra Orcs, he led the front line of the army with his old and weak limbs to help Commander Mos.','0.png'),(437,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease Evasion','Reduction in Evasion. Effect 1.','0.png'),(438,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','One of 4 Guardian Knights that Prince Printesa sold for his safety based on the contract with Halisha. Assigned by Emperor Commodus to protect the safety of the Prince, he did his best, but was sacrificed due to the Prince\'s stupidity. In his lifetime, he was called Valkyrie Alectia of Flames due to his superior beauty, excellent skills and short temper.','0.png'),(439,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','One of 4 Guardian Knights that Prince Printesa sold for his safety based on the contract with Halisha. Assigned by Emperor Commodus to protect the safety of the Prince, he did his best, but was sacrificed due to the Prince\'s stupidity. In his lifetime, he was called Valkyrie Alectia of Calmness due to his superior beauty, excellent skills and cautious character.','0.png'),(440,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','One of 4 Guardian Knights that Prince Printesa sold for his safety based on the contract with Halisha. Assigned by Emperor Commodus to protect the safety of the Prince, he did his best, but was sacrificed due to the Prince\'s stupidity. In his lifetime, he was called Valkyrie Alectia of Snowstorm due to his excellent skills and ice-cold character.','0.png'),(441,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Raid Boss - Level','One of 4 Guardian Knights that Prince Printesa sold for his safety based on the contract with Halisha. Assigned by Emperor Commodus to protect the safety of the Prince, he did his best, but was sacrificed due to the Prince\'s stupidity. In his lifetime, he was called Valkyrie Morigul of Ivory Tower due to his superior beauty, excellent skills and coming from the Ivory Tower.','0.png'),(442,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease Accuracy','Temporarily decreases Accuracy. Effect 1.','0.png'),(443,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC 100% HP Drain - Magic','','0.png'),(444,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Ultimate Debuff','','0.png'),(445,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Cancel PC Target','','0.png'),(446,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','Decrease P.Atk','Temporarily decreases Accuracy. Effect 1.','0.png'),(447,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC AE Solar Flare','','0.png'),(448,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC Monster Hate','','0.png'),(449,'https://l2db.ru/themes/l2db/images/skills/skill0000.png','NPC AE - 80% 